,p_name=>'RW.APEX.CREATE.DOWNLOAD.SCREENSHOTS'
,p_display_name=>'APEX Create and Download Screenshots'
,p_category=>'COMPONENT'
,p_supported_ui_types=>'DESKTOP:JQM_SMARTPHONE'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION F_RENDER (',
'    P_DYNAMIC_ACTION   IN APEX_PLUGIN.T_DYNAMIC_ACTION,',
'    P_PLUGIN           IN APEX_PLUGIN.T_PLUGIN',
') RETURN APEX_PLUGIN.T_DYNAMIC_ACTION_RENDER_RESULT AS',
'    VR_RESULT         APEX_PLUGIN.T_DYNAMIC_ACTION_RENDER_RESULT;',
'BEGIN',
'',
'    APEX_JAVASCRIPT.ADD_LIBRARY(',
'        P_NAME        => ''acads.pkgd.min'',',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX,',
'        P_VERSION     => NULL,',
'        P_KEY         => ''acadsjssrc''',
'    );',
'',
'    APEX_CSS.ADD_FILE(',
'        P_NAME        => ''style'',',
'        P_DIRECTORY   => P_PLUGIN.FILE_PREFIX,',
'        P_VERSION     => NULL,',
'        P_KEY         => ''acadscsssrc''',
'    );',
'',
'    VR_RESULT.JAVASCRIPT_FUNCTION   := ''function () { apexCreateScreenshotPlugin(this, '' || APEX_JAVASCRIPT.ADD_VALUE( P_DYNAMIC_ACTION.ATTRIBUTE_01, FALSE ) || ''); }'';',
'',
'    RETURN VR_RESULT;',
'END;'))
,p_api_version=>1
,p_render_function=>'F_RENDER'
,p_standard_attributes=>'ITEM:BUTTON:REGION:JQUERY_SELECTOR:REQUIRED'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>'This plug-in is used to create and download screenshots from a page elements using html2canvas libary. To hide elements in screenshot just add "data-html2canvas-ignore" into the element attributes.'
,p_version_identifier=>'1.0.0.0'
,p_about_url=>'https://github.com/RonnyWeiss/APEX-Create-and-Download-Screenshots'
,p_files_version=>1342
);
